import React, { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'
var count = 1
const Views = () => {
    const [integers, setIntegers] = useState([])
    async function fetchAllInts(){
        try {
            let response = await axios.get("http://localhost:8800/data/" + count);
            console.log(response);
            setIntegers(response.data);
            if (count == 50){
                count = 1;
            } else {
                count++;
            }
        } catch(err){
            console.log(err)
        }
    }

    useEffect(() => {   
        fetchAllInts()
    })


    return (
        <div>
            <div className="Data">
                {integers.map(integer=>(
                    <div className="Data">
                        <p>{integer.data}</p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Views;
